import { useState, useEffect } from "react";
import ShowAllRecipes from "../sections/ShowAllRecipes";
const { getData, getUserRecipes } = require('../DAL/api')



function Profile() {
    const [recipes, setRecipes] = useState([])
    const [images, setImages] = useState([])


    useEffect(async () => {
        const fetchImages = await getData('images')
        setImages(fetchImages)
        const fetchRecipes = await getUserRecipes(2)
        setRecipes(fetchRecipes)


    }, [])
    return (
        <ShowAllRecipes recipes={recipes} images={images} />
    )
}
export default Profile
